jsonPathKeys:
JSON.stringify({
    variables: {
			name:appsmith.user.email
		},
    query: `
query($name:String!){
  getUser(username:$name){
    name
		id
    hasRole@cascade{
      role{
        name
        hasGrantedRights(filter:{name:{eq:isAdmin}}){
          name
        }
      }
      responsibilities(filter:{equipmentLevel:{eq:Site}}){
        value:id
        label:name
      }
    }
  }
}
    `
})

JSON.stringify({
    variables: {
			carrierId:tblCarriers.selectedRow.id
		},
    query: `
query( $carrierId:ID!){
  getStockOnHand(filter:{carrier:{id:$carrierId},groupBy:{subLot:true, material:true, carrier:true, storageLocation:true}}){
    materialSubLot{code}
    material{code}
    carrier{code}
    storageLocation{name}
    quantity
  }
}
    `
})

JSON.stringify({
    variables: {
			warehouseId:selectWarehouse.selectedOptionValue
		},
    query: `
query ($warehouseId:ID!){
  queryCarrier @cascade {
	  id
    code
    status{code}
    storageLocation{
      label
      name
      id
      warehouse:parent(filter:{id:[$warehouseId]}){
        label
        name
        id
      }
    }
  }
}
    `
})

JSON.stringify({
    variables: {
			id:selectSite.selectedOptionValue
		},
    query: `
query($id:ID!){
	getEquipment(id:$id){
		id
		name
		children(filter:{equipmentLevel:{eq:Warehouse},not:{isActive:false}}){
			value:id
			label:name
		}
	}
}
    `
})
